import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
function App() {
  return (
    <div className="card align-items-center m-5">
      <h5 className="card-title">Todo App</h5>
      <button className="btn-primary">Hello</button>
    </div>
  );
}

export default App;
